INSERT INTO `clase` VALUES ('0002','Proyecto Clase 190','0002','H001',1,'juan','juan','2025-01-29','16:04:25','2025-02-05','10:42:09','2025-01-29','2025-04-30','MARTES - JUEVES - SABADO','Sesión de Entrenamiento\nEsta sesión de entrenamiento está diseñada para desarrollar y perfeccionar las capacidades físicas, técnicas y tácticas de los jugadores, de acuerdo con los objetivos específicos de la categoría.\n\n? Fase de Activación y Movilidad Articular\nLa clase iniciará con una fase de activación y movilidad articular para preparar el cuerpo.\n\n? Trabajo Físico\nSe trabajará en la resistencia, velocidad y coordinación para mejorar el rendimiento deportivo.\n\n? Ejercicios Técnicos\nSe enfocarán en:\n✔ Control del balón\n✔ Pase y conducción\n✔ Finalización de jugadas\n\n? Dinámicas Tácticas\nEjercicios orientados a la toma de decisiones y lectura del juego en situaciones reales.\n\n? Vuelta a la Calma\nLa sesión concluirá con ejercicios de recuperación y estiramientos para prevenir lesiones.'),('0003','CLase SUb 16','0001','H003',1,'juan','juan','2025-02-04','20:46:36','2025-02-14','09:54:25','2025-02-04','2025-05-31','LUNES - MIERCOLES - VIERNES','Sesión de Entrenamiento\nEsta sesión de entrenamiento está diseñada para desarrollar y perfeccionar las capacidades físicas, técnicas y tácticas de los jugadores, de acuerdo con los objetivos específicos de la categoría.\n\n? Fase de Activación y Movilidad Articular\nLa clase iniciará con una fase de activación y movilidad articular para preparar el cuerpo.\n\n? Trabajo Físico\nSe trabajará en la resistencia, velocidad y coordinación para mejorar el rendimiento deportivo.\n\n? Ejercicios Técnicos\nSe enfocarán en:\n✔ Control del balón\n✔ Pase y conducción\n✔ Finalización de jugadas\n\n? Dinámicas Tácticas\nEjercicios orientados a la toma de decisiones y lectura del juego en situaciones reales.\n\n? Vuelta a la Calma\nLa sesión concluirá con ejercicios de recuperación y estiramientos para prevenir lesiones.'),('0004','rex','0003','H003',1,'juan','juan','2025-02-04','21:00:46','2025-02-14','09:54:30','2025-02-04','2025-02-26','MARTES - JUEVES - SABADO','Sesión de Entrenamiento\nEsta sesión de entrenamiento está diseñada para desarrollar y perfeccionar las capacidades físicas, técnicas y tácticas de los jugadores, de acuerdo con los objetivos específicos de la categoría.\n\n? Fase de Activación y Movilidad Articular\nLa clase iniciará con una fase de activación y movilidad articular para preparar el cuerpo.\n\n? Trabajo Físico\nSe trabajará en la resistencia, velocidad y coordinación para mejorar el rendimiento deportivo.\n\n? Ejercicios Técnicos\nSe enfocarán en:\n✔ Control del balón\n✔ Pase y conducción\n✔ Finalización de jugadas\n\n? Dinámicas Tácticas\nEjercicios orientados a la toma de decisiones y lectura del juego en situaciones reales.\n\n? Vuelta a la Calma\nLa sesión concluirá con ejercicios de recuperación y estiramientos para prevenir lesiones.');
