INSERT INTO `clasedev` VALUES ('0001','0002','La clase de Técnica Individual está diseñada para perfeccionar y fortalecer las habilidades específicas de cada estudiante dentro de su disciplina, ya sea deportiva, artística o académica. A través de un enfoque personalizado, se trabajará en el desarrollo de la precisión, coordinación, fluidez y ejecución técnica de los movimientos fundamentales, garantizando una base sólida para el progreso continuo.\n\n','El principal objetivo de la Clase de Técnica Individual es proporcionar a los estudiantes herramientas y estrategias efectivas para optimizar su desempeño en la ejecución de movimientos técnicos específicos. Se pretende mejorar la precisión, la coordinación, la postura y el control de cada acción, asegurando que cada estudiante pueda ejecutar sus habilidades con mayor eficiencia y confianza.\n\nA lo largo del proceso de aprendizaje, se trabajará en la identificación y corrección de errores técnicos, reforzando la importancia de la práctica consciente y estructurada. También se promoverá el desarrollo de la autonomía y la autoevaluación, fomentando que cada estudiante adquiera una mentalidad de mejora continua y un compromiso con su propio crecimiento técnico y profesional.\n\n\n',1,NULL,NULL,'2025-02-06','07:44:48','2025-02-07','16:35:10',NULL,NULL,NULL,'MARTES','Clase de Técnica Individual'),('0002','0002','La Clase de Táctica y Estrategia en Fútbol está enfocada en mejorar la comprensión del juego, tanto a nivel individual como colectivo. Se trabajará en la organización dentro del campo, el posicionamiento correcto en función del balón y los rivales, y la toma de decisiones en diferentes situaciones de partido.\n\nA través de ejercicios prácticos, simulaciones y análisis de juego, los jugadores aprenderán a aplicar estrategias ofensivas y defensivas, optimizando su rendimiento en equipo y potenciando su inteligencia táctica.','El principal objetivo de esta clase es fortalecer la capacidad táctica de los jugadores, permitiéndoles leer el juego con mayor claridad y reaccionar de manera efectiva ante distintos escenarios de partido.\n\nPara ello, se trabajará en:\n✅ Ubicación y posicionamiento: Mejorar la colocación en el campo según la fase de juego (ataque, defensa, transición).\n✅ Movimientos con y sin balón: Desarrollar desmarques, apoyos y coberturas defensivas.\n✅ Estrategias ofensivas: Aprender a generar superioridades numéricas y circulación efectiva del balón.\n✅ Estrategias defensivas: Aplicar conceptos como presión, repliegue y marcaje zonal o individual.\n✅ Toma de decisiones: Potenciar la lectura de juego y la anticipación de jugadas.',1,NULL,NULL,NULL,NULL,'2025-02-11','14:34:34',NULL,NULL,NULL,'JUEVES','Clase de Táctica y Estrategia'),('0003','0002','2','2',1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'SABADO','Clase de Preparación Física'),('0004','0003','La Clase de Técnica Individual en Fútbol está diseñada para mejorar el dominio del balón y la ejecución precisa de los fundamentos técnicos esenciales. A través de ejercicios específicos y progresivos, los jugadores desarrollarán habilidades clave como control, pase, conducción, regate, tiro y toma de decisiones, aplicándolas en situaciones de juego real.\n\nEl enfoque se centra en la corrección de errores técnicos, el perfeccionamiento de movimientos y la mejora de la coordinación, asegurando que cada futbolista adquiera mayor confianza y efectividad en su rendimiento individual dentro del campo.','El objetivo principal de esta clase es perfeccionar la técnica individual de los jugadores, optimizando su capacidad para manejar el balón con precisión, control y creatividad.\n\nPara ello, se trabajará en:\n✅ Control y primer toque: Mejorar la recepción y orientación del balón para facilitar la siguiente acción.\n✅ Pase y visión de juego: Aumentar la precisión y rapidez en la distribución del balón.\n✅ Regate y conducción: Desarrollar el manejo eficiente del balón en velocidad y bajo presión.\n✅ Finalización: Mejorar la técnica de golpeo y toma de decisiones en el área.\n✅ Coordinación y agilidad: Fortalecer la movilidad y el equilibrio para ejecutar movimientos más eficientes.',1,NULL,NULL,'2025-02-11','14:25:29','2025-02-11','14:32:11',NULL,NULL,NULL,'LUNES','Clase de Técnica Individual'),('0005','0003','La Clase de Técnica Individual en Fútbol está diseñada para mejorar y perfeccionar las habilidades fundamentales de cada jugador, asegurando un mayor control, precisión y eficacia en la ejecución de los movimientos técnicos.\n\nA través de un enfoque personalizado y progresivo, se trabajará en aspectos clave como el control de balón, pase, regate, conducción, tiro y toma de decisiones en situaciones reales de juego. Cada ejercicio se enfocará en la correcta ejecución de la técnica, corrigiendo errores y potenciando la confianza de los jugadores en su desempeño individual.','El objetivo principal de la Clase de Técnica Individual en Fútbol es optimizar la calidad técnica de cada jugador, permitiéndole desarrollar un mayor dominio del balón y mejorar su desempeño en el campo.\n\nPara lograrlo, se trabajará en:\n✅ Precisión y control: Mejorar la calidad del primer toque, la orientación del control y la seguridad en los pases.\n✅ Regate y conducción: Aumentar la capacidad de sortear rivales con cambios de ritmo y dirección.\n✅ Finalización y disparo: Perfeccionar la potencia y colocación en los remates a portería.\n✅ Toma de decisiones: Fomentar la lectura del juego y la reacción rápida en diferentes escenarios.',1,NULL,NULL,'2025-02-11','14:30:42','2025-02-11','14:31:11',NULL,NULL,NULL,'MIERCOLES','Clase de Preparación Física'),('0006','0003','La Clase de Táctica y Estrategia en Fútbol está enfocada en mejorar la comprensión del juego, tanto a nivel individual como colectivo. Se trabajará en la organización dentro del campo, el posicionamiento correcto en función del balón y los rivales, y la toma de decisiones en diferentes situaciones de partido.\n\nA través de ejercicios prácticos, simulaciones y análisis de juego, los jugadores aprenderán a aplicar estrategias ofensivas y defensivas, optimizando su rendimiento en equipo y potenciando su inteligencia táctica.','El principal objetivo de esta clase es fortalecer la capacidad táctica de los jugadores, permitiéndoles leer el juego con mayor claridad y reaccionar de manera efectiva ante distintos escenarios de partido.\n\nPara ello, se trabajará en:\n✅ Ubicación y posicionamiento: Mejorar la colocación en el campo según la fase de juego (ataque, defensa, transición).\n✅ Movimientos con y sin balón: Desarrollar desmarques, apoyos y coberturas defensivas.\n✅ Estrategias ofensivas: Aprender a generar superioridades numéricas y circulación efectiva del balón.\n✅ Estrategias defensivas: Aplicar conceptos como presión, repliegue y marcaje zonal o individual.\n✅ Toma de decisiones: Potenciar la lectura de juego y la anticipación de jugadas.',1,NULL,NULL,'2025-02-11','14:32:21','2025-02-11','14:33:05',NULL,NULL,NULL,'VIERNES','Clase de Táctica y Estrategia');
