INSERT INTO `ejercicios` VALUES ('0001','Control y Pase en Espacios Reducidos','En parejas, separados 5-7 metros.\nPases rasos con control orientado antes de devolver el pase.\nAlternar control con pie derecho, izquierdo y muslo.','Técnica - Control y Pase',NULL,NULL,NULL,NULL,NULL,NULL,'Media','3 series de 4 min','0001'),('0002','Conducción con Cambios de Ritmo','Zigzagueo entre conos (7-10 metros) usando interior y exterior del pie.\nAl final del recorrido, sprint con el balón.\nVariaciones: conducir con pierna menos hábil, cambios de dirección rápidos','Técnica - Conducción y Agilidad',NULL,NULL,NULL,NULL,NULL,NULL,'Alta',' 3 repeticiones de ida y vuelta','0001'),('0003','Regate y Fintas en 1v1','Jugadores enfrentados en una zona de 10x10m.\nUn atacante intenta superar al defensor con fintas.\nAl ganar el duelo, finaliza con un pase o tiro.','Técnica - Regate y Duelo',NULL,NULL,'2025-02-07','22:05:07',NULL,NULL,'Alta','3 series de 4 min','0001'),('0004','Pases de Precisión y Cambio de Orientación','Pases largos y cambios de orientación (20-30 metros).\nControl con el primer toque y pase inmediato.\nVariación: pases aéreos y rasos.','Técnica - Pase Largo','2025-02-07','18:59:01',NULL,NULL,'P12345678',NULL,'Media',NULL,'0001'),('0005','Finalización con Tiro a Puerta','Recepción de un pase frontal, control y disparo.\nVariaciones: tiros de primera, remates con pierna débil.\nObjetivo: mejorar precisión y potencia.','Técnica - Tiro y Finalización',NULL,NULL,'2025-02-07','22:04:14',NULL,NULL,'Media',NULL,'0001'),('0006','Fuerza Explosiva y Potencia','Saltos pliométricos en cajón (3x10 repeticiones).\nSentadillas con salto (3x8 repeticiones).\nZancadas con impulso (3x8 repeticiones por pierna).','Fuerza - Tren inferio','2025-02-07','19:46:14',NULL,NULL,'P12345678',NULL,'Alta',NULL,'0004'),('0007','Control y Pase en Espacios Reducidos','En parejas, separados 5-7 metros.\nPases rasos con control orientado antes de devolver el pase.\nAlternar control con pie derecho, izquierdo y muslo.','Técnica - Control y Pase','2025-02-14','11:10:18',NULL,NULL,'P12345678',NULL,'media',' 3 series de 4 min','0001'),('0008','Fuerza Explosiva y Potencia','Saltos pliométricos en cajón (3x10 repeticiones).\nSentadillas con salto (3x8 repeticiones).\nZancadas con impulso (3x8 repeticiones por pierna).','2222','2025-02-14','11:14:33',NULL,NULL,'P12345678',NULL,'media','Fuerza - Tren inferio','0004'),('0009','aaa','222','222','2025-02-14','11:24:22',NULL,NULL,'P12345678',NULL,'media','22','0004'),('0010','2222','222','222','2025-02-14','11:24:46',NULL,NULL,'P12345678',NULL,'media','222','0004'),('0011','33','3333','33','2025-02-14','11:49:39',NULL,NULL,'P12345678',NULL,'media','33','0001'),('0012','andres','222','222','2025-02-14','12:11:34',NULL,NULL,'P12345678',NULL,'media','22','0003'),('0013','222','222','222',NULL,NULL,'2025-02-15','20:26:24',NULL,NULL,'Media','22','0006');
